x6tBAOfNjIoSG4',_binary 'a:5:{s:7:\"#markup\";O:25:\"Drupal\\Core\\Render\\Markup\":1:{s:9:\"\0*\0string\";s:1707:\"\n<article data-history-node-id=\"102\" data-quickedit-entity-id=\"node/102\" role=\"article\" class=\"contextual-region node node--type-villes node--view-mode-full clearfix\" about=\"/ville_de_france/web/villes/lille\">\n  <header>\n    \n          <div data-contextual-id=\"node:node=102:changed=1573205806&amp;langcode=en\" data-contextual-token=\"nH_Bn9mFnFL5hh2RRnghCuujptl_ZaWXlmSyPxd0KsM\"></div>\n      </header>\n  <div class=\"node__content clearfix\">\n    \n            <div data-quickedit-field-id=\"node/102/field_title/en/full\" class=\"clearfix text-formatted field field--name-field-title field--type-text field--label-hidden field__item\"></div>\n      \n            <div data-quickedit-field-id=\"node/102/field_description/en/full\" class=\"clearfix text-formatted field field--name-field-description field--type-text field--label-hidden field__item\">Lille est la capitale des Hauts-de-France, une région du nord de la France. Elle se trouve à proximité de la frontière belge. Aujourd\'hui centre culturel et ville universitaire animée, elle fut autrefois une importante plateforme marchande des Flandres françaises, et de nombreuses influences flamandes demeurent encore. Le centre historique, le Vieux Lille, se caractérise par ses maisons de ville du XVIIe siècle en briques rouges, ses ruelles piétonnes pavées et sa Grand\'Place centrale.</div>\n      \n            <div data-quickedit-field-id=\"node/102/field_image/en/full\" class=\"field field--name-field-image field--type-image field--label-hidden field__item\">  <img src=\"/ville_de_france/web/sites/default/files/2019-11/une-ccigrandlille_0.jpg\" width=\"2001\" height=\"1599\" alt=\"La ville de Lille\" typeof=\"foaf:Image\" />\n\n</div>\n      \n  </div>\n</article>\n\";}s:9:\"#attached\";a:3:{s:14:\"html_head_link\";a:7:{i:0;a:2:{i:0;a:2:{s:3:\"rel\";s:9:\"canonical\";s:4:\"href\";s:49:\"http: