                       <td class=\"views-field views-field-field-image views-align-center\">  <img src=\"/ville_de_france/web/sites/default/files/styles/large/public/2019-11/maxnewsspecial150993-3842012.jpg?itok=KYDYofLj\" width=\"480\" height=\"270\" alt=\"Ville de Valenciennes\" typeof=\"foaf:Image\" class=\"image-style-large\" />\n\n\n          </td>\n              </tr>\n          <tr>\n                                                                                        <td class=\"views-field views-field-title views-align-left\"><a href=\"/ville_de_france/web/villes/amiens\" hreflang=\"en\">Amiens</a>          </td>\n                                                                                        <td class=\"views-field views-field-field-description views-align-center\">Amiens est une ville du nord de la France, traversée par la Somme. Elle est connue pour sa cathédrale gothique et son beffroi médiéval situé à proximité. Des boutiques et des cafés bordent les ruelles du quartier Saint-Leu. Les canaux de la ville sont parsemés de jardins flottants, les \"hortillonnages\". Le musée de Picardie expose des œuvres d\'art et des antiquités sur une période de plusieurs siècles. La maison de Jules Verne, toute proche, est un musée où l\'auteur de science-fiction vécut          </td>\n                                                                                        <td class=\"views-field views-field-field-image views-align-center\">  <img src=\"/ville_de_france/web/sites/default/files/styles/large/public/2019-11/1280px-0_Amiens_-_Place_du_Don_-_Cath%C3%A9drale_%281%29.JPG?itok=sljHmS0_\" width=\"480\" height=\"320\" alt=\"Ville d&#039;Amiens\" typeof=\"foaf:Image\" class=\"image-style-large\" />\n\n\n          </td>\n              </tr>\n          <tr>\n                                                                                        <td class=\"views-field views-field-title views-align-left\"><a href=\"/ville_de_france/web/villes/lille\" hreflang=\"en\">Lille</a>          </td>\n                                                                                        <td class=\"views-field views-field-field-description views-align-center\">Lille est la capitale des Hauts-de-France, une région du nord de la France. Elle se trouve à proximité de la frontière belge. Aujourd\'hui centre culturel et ville universitaire animée, elle fut autrefois une importante plateforme marchande des Flandres françaises, et de nombreuses influences flamandes demeurent encore. Le centre historique, le Vieux Lille, se caractérise par ses maisons de ville du XVIIe siècle en briques rouges, ses ruelles piétonnes pavées et sa Grand\'Place centrale.          </td>\n                                                                                        <td class=\"views-field views-field-field-image views-align-center\">  <img src=\"/ville_de_france/web/sites/default/files/styles/large/public/2019-11/une-ccigrandlille_0.jpg?itok=0LeIYnSU\" width=\"480\" height=\"384\" alt=\"La ville de Lille\" typeof=\"foaf:Image\" class=\"image-style-large\" />\n\n\n          </td>\n              </tr>\n      </tbody>\n</table>\n\n    </div>\n  \n      \n          </div>\n</div>\n\";}s:9:\"#attached\";a:2:{s:7:\"library\";a:2:{i:0;s:18:\"views/views.module\";i:1;s:18:\"views/views.module\";}s:14:\"drupalSettings\";a:0:{}}s:6:\"#cache\";a:3:{s:8:\"contexts\";a:6:{i:0;s:26:\"languages:language_content\";i:1;s:28:\"languages:language_interface\";i:2;s:5:\"theme\";i:3;s:14:\"url.query_args\";i:4;s:21:\"user.node_grants:view\";i:5;s:16:\"user.permissions\";}s:4:\"tags\";a:12:{i:0;s:43:\"config:field.storage.node.field_description\";i:1;s:37:\"config:field.storage.node.field_image\";i:2;s:31:\"config:filter.format.basic_html\";i:3;s:24:\"config:image.style.large\";i:4;s:24:\"config:views.view.villes\";i:5;s:6:\"file:6\";i:6;s:6:\"file:7\";i:7;s:6:\"file:9\";i:8;s:8:\"node:102\";i:9;s:8:\"node:103\";i:10;s:8:\"node:104\";i:11;s:9:\"node_list\";}s:7:\"max-age