ute proche, est un musée où l\'auteur de science-fiction vécut\";}}s:11:\"field_image\";a:1:{s:7:\"#markup\";O:25:\"Drupal\\Core\\Render\\Markup\":1:{s:9:\"\0*\0string\";s:259:\"  <img src=\"/ville_de_france/web/sites/default/files/styles/large/public/2019-11/1280px-0_Amiens_-_Place_du_Don_-_Cath%C3%A9drale_%281%29.JPG?itok=sljHmS0_\" width=\"480\" height=\"320\" alt=\"Ville d&#039;Amiens\" typeof=\"foaf:Image\" class=\"image-style-large\" />\n\n\n\";}}}',-1,1573223338.714,1,'config:filter.format.basic_html config:image.style.large config:views.view.villes file:7 node:103 rendered','30'),('views:fields:villes:page_1:1bba7a05c2b520756be50a78f7aa9c75d280398d7c60db103083fc2eec5c2846:[languages:language_interface]=en:[theme]=ville_de_france:[user.permissions]=dead7f76227833dbc6cdca9ac4384a756fa7f9657912c49d421b55af735e4b25',_binary 'a:7:{s:7:\"#markup\";s:0:\"\";s:9:\"#attached\";a:0:{}s:6:\"#cache\";a:3:{s:8:\"contexts\";a:3:{i:0;s:28:\"languages:language_interface\";i:1;s:5:\"theme\";i:2;s:16:\"user.permissions\";}s:4:\"tags\";a:5:{i:0;s:31:\"config:filter.format.basic_html\";i:1;s:24:\"config:image.style.large\";i:2;s:24:\"config:views.view.villes\";i:3;s:6:\"file:9\";i:4;s:8:\"node:104\";}s:7:\"max-age\";i:-1;}s:17:\"#cache_properties\";a:3:{i:0;s:5:\"title\";i:1;s:17:\"field_description\";i:2;s:11:\"field_image\";}s:5:\"title\";a:1:{s:7:\"#markup\";O:25:\"Drupal\\Core\\Render\\Markup\":1:{s:9:\"\0*\0string\";s:81:\"<a href=\"/ville_de_france/web/villes/valenciennes\" hreflang=\"en\">Valenciennes</a>\";}}s:17:\"field_description\";a:1:{s:7:\"#markup\";O:25:\"Drupal\\Core\\Render\\Markup\":1:{s:9:\"\0*\0string\";s:241:\"Valenciennes est une commune française, historiquement capitale du comté du Hainaut français et aujourd\'hui sous-préfecture du département du Nord, en région Hauts-de-France. Elle est située au confluent de l\'Escaut avec la Rhônelle.\";}}s:11:\"field_image\";a:1:{s:7:\"#markup\";O:25:\"Drupal\\Core\\Render\\Markup\":1:{s:9:\"\0*\0string\";s:233:\"  